INSERT INTO `products` (`id`, `category_id`, `sku`, `name`, `description`, `picture_name`, `price`, `current_discount`, `stock`, `product_unit`, `is_available`, `add_date`) VALUES
(18, 1, 'UJS924235', 'Ubi Jepang', 'Ubi jepang memiliki kandungan asam hyaluronic yang sangat dibutuhkan untuk segala solusi kecantikan kulit dan menjaga jaringan supaya selalu lembab, mengatasi kulit kering dan kerutan halus pada wajah. Asam hyaluronic dalam ubi jepang akan mempertahankan elastisitas kulit sehingga bisa menyembuhkan luka serta jaringan parut yang nantinya akan memberikan tampilan awet muda pada kulit secara menyeluruh.', 'ubi-jepang.jpeg', '9500.00', '0.00', 24, 'kg', 1, '2020-12-05 05:57:15'),
(19, 4, 'ABD48850', 'Ayam Broiler', 'Ayam broiler merupakan ternak yang paling ekonomis bila dibandingkan dengan ternak lain, kelebihan yang dimiliki adalah kecepatan pertambahan/produksi daging dalam waktu yang relatif cepat dan singkat atau sekitar 4 - 5 minggu produksi daging sudah dapat dipasarkan atau dikonsumsi.', 'ayam-bolier.jpeg', '40500.00', '0.00', 8, 'pcs', 1, '2020-12-05 06:07:30'),
(20, 4, 'APD210046', 'Ayam Pejantan', 'Ayam pejantan adalah sejenis ayam petelur namun jenis ayam ini adalah ayam afkir atau limbah sortiran dari hasil produksi ayam petelur. ', 'ayam-pejantan.jpeg', '29000.00', '0.00', 10, '500-600 Gr/Pcs', 1, '2020-12-05 06:10:46'),
(22, 4, 'ABD95004', 'Ayam Boneless', 'Ayam Boneless Dada menjadi pilihan utama jikalau membeli ayam. Selain praktis karna tanpa tulang, boneless dada rendak lemak dan tinggi protein yang baik untuk pertumbuhan sel dan masa otot', 'ayam-boneless.jpeg', '92000.00', '0.00', 5, 'pack', 1, '2020-12-05 06:26:44'),
(23, 4, 'TAD114693', 'Telur Asin', 'Bagi yang ingin mempertahankan berat badan idel, telur asin merupakan salah satu makanan yang cocok dikonsumsi. Kandungan Kalsium pada telur asin bersifat penunda lapar dan bisa membantu menstabilkan tekanan darah', 'telur-asin.jpg', '17500.00', '0.00', 14, 'pack', 1, '2020-12-05 06:38:13'),
(24, 4, 'TAD214784', 'Telur Ayam', 'Kandungan gizi telur ayam negeri ternyata ada banyak sekali, mulai dari vitamin, mineral, dan juga protein. Ada lebih dari 90% zat besi dan kalsium yang terkandung dalam 1 kuning telur. Sedangkan dalam putih telurnya ada protein dan asam amino lainnya. Tentu saja semua itu baik untuk kesehatan.', 'telur-ayam.jpg', '25000.00', '0.00', 14, 'kg', 1, '2020-12-05 06:39:44'),
(25, 1, 'BHS325654', 'Bayam Hijau', 'Bayam memiliki kandungan vitamin A yang tinggi dan sangat baik untuk kesehatan mata kita. Vitamin A pada Bayam mampu meminimalisir sakit pada mata manusia. Serat dalam Bayam mampu menghindarkan manusia dari sakit maag yang dipicu karena kurangnya serat dalam tubuh.', 'bayam-hijau.jpg', '3000.00', '0.00', 25, 'pack', 1, '2020-12-05 06:54:14'),
(26, 1, 'PHS330769', 'Paprika Hijau', 'Paprika sangat rendah kalori. Meskipun Anda menghabiskan secangkir penuh paprika, hanya ada 45 kalori di dalamnya. Namun porsi tersebut sudah mampu memberikan asupan vitamin A dan C harian. Kandungan sulfur dalam paprika berperan dalam memerangi beberapa jenis kanker tertentu.', 'paprika-hijau.jpeg', '36500.00', '0.00', 30, 'kg', 1, '2020-12-05 06:56:09'),
(27, 1, 'WLS16286', 'Wortel Lokal', 'Mengonsumsi wortel secara rutin dapat melindungi tubuh dari berbagai jenis kanker seperti kanker prostat, kanker usus, kanker perut, kanker paru, kanker lambung, dan kanker payudara. Kandungan karotenoid dan beta karoten yang tinggi mencegah terjadinya semua penyakit tersebut. Sebuah penelitian menunjukkan bahwa perokok yang mengonsumsi wortel lebih dari satu buah dalam seminggu dapat menurunkan risiko kanker paru.', 'wortel-lokal.jpeg', '10000.00', '0.00', 6, 'kg', 1, '2020-12-05 07:04:46'),
(28, 1, 'BS37343', 'Buncis', 'Buncis mengandung fosfor yang dapat membantu menjaga keseimbangan asam dan basa bagi tubuh, serta bersama kalsium membantu kerja otot. Selain itu, Buncis memiliki Indeks Glikemik yang rendah, sehingga dapat mencegah terjadinya diabetes. Folat yang terkandung di dalam Buncis dapat membantu mengurangi depresi.', 'buncis.jpg', '3000.00', '0.00', 7, 'pack', 1, '2020-12-05 07:05:43'),
(29, 1, 'KPS315437', 'Kacang Panjang', 'Dalam 100 gram Kacang Panjang mengandung 62 mg folat atau setara 15 persen dari total kebutuhan harian folat. Folat dibarengi dengan vitamin B12 adalah salah satu komponen penting dari sintesis DNA dan pembelahan sel. Kacang Panjang segar juga mengandung sederet antioksidan yang penting untuk tubuh, seperti vitamin C, riboflavin, dan betakaroten. Vitamin C yang terdapat dalam Kacang Panjang cukup untuk memenuhi 31 persen dari kebutuhan vitamin C harian Anda.', 'kacang-panjang.jpg', '30000.00', '0.00', 15, 'pack', 1, '2020-12-05 07:07:17'),
(30, 1, 'LS914494', 'Lolorosa', 'Daun selada kaya akan folat. Di dalam tubuh Anda, folat berfungsi untuk mengolah asam amino bernama homosistein dalam darah. Sedangkan kadar homosistein dalam darah yang terlalu tinggi bisa menimbulkan berbagai masalah pada jantung.', 'lolorosa.jpg', '9000.00', '0.00', 14, 'pack', 1, '2020-12-05 07:08:14'),
(31, 2, 'BB220752', 'Belimbing', 'Manfaat belimbing madu untuk kesehatan tidak diragukan lagi. Berbagai kandungan vitamin, mineral dan zat penting lainnya yang ada pada tubuh mampu memberikan manfaat bagi kecantikan dan kesehatan. Khususnya bagi para wanita yang menjalani program diet, buah belimbing madu dapat menjadi salah satu solusi', 'belimbing.jpg', '23000.00', '0.00', 20, 'kg', 1, '2020-12-05 07:12:32'),
(32, 2, 'AMB325874', 'Apel Malang', 'Apel Malang mengandung zat-zat penting untuk tubuh seperti serat pektin, quercetin (bahan anti kanker dan radang), serta vitamin C yang tinggi sebagai antioksidan. Karena alasan inilah banyak ahli medis yang menyarankan kita untuk rutin mengkonsumsi buah Apel.', 'apel-malang.jpg', '39000.00', '0.00', 25, 'kg', 1, '2020-12-05 07:14:34'),
(33, 2, 'JBB123940', 'Jambu Biji', 'Jambu batu merah merupakan buah buni, bentuk bulat, dengan warna kulit buah hijau saat muda dan kuning saat matang serta daging buah berwarna merah dan banyak mengandung biji. Jambu batu merah mengandung vitamin A, vitamin C, kalium, dan zat-zat antioksidan.', 'jambu-biji.jpg', '14000.00', '0.00', 23, 'kg', 1, '2020-12-05 07:15:40'),
(34, 2, 'SKB625004', 'Semangka Kuning', 'Buah semangka merupakan sumber likopen yang sangat baik, bahkan kandungannya lebih tinggi daripada di tomat atau sayuran lainnya. Likopen merupakan antioksidan yang dapat membantu menjaga kesehatan kulit, jantung, dan menangkal kanker prostat.', 'semangka-kuning.jpeg', '61000.00', '0.00', 25, 'pcs', 1, '2020-12-05 07:16:44'),
(35, 2, 'SMB321128', 'Semangka Merah', 'Berikut ini adalah fakta Semangka yang sebaiknya kamu ketahui.1. Bagian Semangka terdiri dari 92 persen air dan bisa menghilangkan dehidrasi. 2. Ternyata Semangka bisa memperbaiki mood kamu lho. Semangka memiliki kandungan B6, sebuah nutrisi yang penting dalam sintesis neurotransmitter yang bertanggung jawab untuk memenangkan hati.3. Ternyata Semangka bukan jenis buah lho. Semangka termasuk tanaman semusim sehingga di Amerika, Eropa, Jepang, digolongkan ke dalam kelompok tomat, cabai, terong sebagai golongan sayuran.', 'semangka-merah.jpg', '35000.00', '0.00', 21, 'pcs', 1, '2020-12-05 07:18:48'),
(36, 2, 'LLB225204', 'Lemon Lokal', 'Lemon kuning adalah buah dengan bentuk lonjong dan memiliki kadar air tinggi dan rasa manis asam yang segar. Biasanya, selain air perasan buahnya, kulit jeruk lemon yang diparut juga banyak digunakan sebagai bahan tambahan pada pembuatan kue atau makanan penutup lainnya. ', 'lemon-kuning.jpg', '23000.00', '0.00', 25, 'kg', 1, '2020-12-05 07:20:04');

